import React, { useEffect, useState } from "react";
import "../Css/Profile.css";

function Profile() {
  const mobile = localStorage.getItem("userMobile");

  const [user, setUser] = useState({
    fullName: "",
    email: "",
    address: "",
    state: "",
    district: "",
    pincode: "",
    farmSize: "",
    mainCrops: "",
    bankAccount: "",
    ifsc: "",
    gst: "",
    pan: "",
    aadhar: "",
    profilePhoto: "",
    document1: "",
    document2: "",
    verified: 0,
    role: "Farmer",
  });

  const [photoFile, setPhotoFile] = useState(null);
  const [doc1, setDoc1] = useState(null);
  const [doc2, setDoc2] = useState(null);

  useEffect(() => {
    fetch(`http://localhost:9090/backend/api/user/get-profile?mobile=${mobile}`)
      .then((res) => res.json())
      .then((data) => {
        if (data.status === "success") {
          setUser({ ...user, ...data.user });
        } else {
          console.log("User not found");
        }
      });
  }, []);

  const handleChange = (e) => {
    setUser({ ...user, [e.target.name]: e.target.value });
  };

  const handleSave = async () => {
    const fd = new FormData();

    fd.append("mobile", mobile);
    fd.append("fullName", user.fullName);
    fd.append("email", user.email);
    fd.append("address", user.address);
    fd.append("state", user.state);
    fd.append("district", user.district);
    fd.append("pincode", user.pincode);
    fd.append("role", user.role);
    fd.append("farmSize", user.farmSize);
    fd.append("mainCrops", user.mainCrops);
    fd.append("bankAccount", user.bankAccount);
    fd.append("ifsc", user.ifsc);
    fd.append("gst", user.gst);
    fd.append("pan", user.pan);
    fd.append("aadhar", user.aadhar);

    if (photoFile) fd.append("profilePhoto", photoFile);
    if (doc1) fd.append("document1", doc1);
    if (doc2) fd.append("document2", doc2);

    const res = await fetch("http://localhost:9090/backend/api/user/update-profile", {
      method: "POST",
      body: fd,
    });

    const data = await res.json();
    alert(data.message);
  };

  return (
    <div className="profile-page-background">
      <div className="profile-card">

        <div className="profile-header">
          <h2>User Profile</h2>
          <button className="logout-btn"
            onClick={() => {
              localStorage.clear();
              window.location.href = "/login";
            }}>
            Logout
          </button>
        </div>

        <div className="profile-form-layout">

          {/* LEFT SIDE */}
          <div>
            <h3 className="section-title">Personal Details</h3>

            <div className="photo-upload-container">
              <img
                src={
                  photoFile
                    ? URL.createObjectURL(photoFile)
                    : user.profilePhoto
                    ? "http://localhost:9090/backend/" + user.profilePhoto
                    : "/default-avatar.png"
                }
                className="profile-photo"
              />

              <label className="custom-file-label">
                Choose Photo
                <input type="file" hidden onChange={(e) => setPhotoFile(e.target.files[0])} />
              </label>
            </div>

            <select name="role" className="form-input" value={user.role} onChange={handleChange}>
              <option value="Farmer">Farmer</option>
              <option value="Buyer">Buyer</option>
            </select>

            <input name="fullName" className="form-input" placeholder="Full Name"
              value={user.fullName} onChange={handleChange} />

            <input name="email" className="form-input" placeholder="Email"
              value={user.email} onChange={handleChange} />

            <textarea name="address" className="form-input textarea"
              placeholder="Address" value={user.address} onChange={handleChange} />

            <div className="input-group-row">
              <input name="state" className="form-input" placeholder="State"
                value={user.state} onChange={handleChange} />
              <input name="district" className="form-input" placeholder="District"
                value={user.district} onChange={handleChange} />
            </div>

            <input name="pincode" className="form-input" placeholder="Pincode"
              value={user.pincode} onChange={handleChange} />

            <div className="aadhar-section">
              <input name="aadhar" className="form-input" placeholder="Aadhar"
                value={user.aadhar} onChange={handleChange} />

              <span className="verify-status">
                {user.verified === 1 ? <span className="verified">✔ Verified</span> : <span className="pending">⏳ Pending</span>}
              </span>
            </div>
          </div>

          {/* RIGHT SIDE */}
          <div>
            <h3 className="section-title">Farm & Business</h3>

            <div className="input-group-row">
              <input name="farmSize" className="form-input" placeholder="Farm Size"
                value={user.farmSize} onChange={handleChange} />

              <input name="mainCrops" className="form-input" placeholder="Main Crops"
                value={user.mainCrops} onChange={handleChange} />
            </div>

            <div className="input-group-row">
              <input name="gst" className="form-input" placeholder="GST"
                value={user.gst} onChange={handleChange} />

              <input name="pan" className="form-input" placeholder="PAN"
                value={user.pan} onChange={handleChange} />
            </div>

            <h3 className="section-title">Bank</h3>

            <input name="bankAccount" className="form-input" placeholder="Bank Account"
              value={user.bankAccount} onChange={handleChange} />

            <input name="ifsc" className="form-input" placeholder="IFSC"
              value={user.ifsc} onChange={handleChange} />

            <h3 className="section-title">Documents</h3>

            <div className="doc-upload-container">
              <label className="doc-upload-label">Land Proof:</label>
              <label className="circle-upload">
                +
                <input type="file" className="hidden-file-input"
                  onChange={(e) => setDoc1(e.target.files[0])} />
              </label>
            </div>

            <div className="doc-upload-container">
              <label className="doc-upload-label">Other Doc:</label>
              <label className="circle-upload">
                +
                <input type="file" className="hidden-file-input"
                  onChange={(e) => setDoc2(e.target.files[0])} />
              </label>
            </div>
          </div>
        </div>

        <button className="save-profile-btn" onClick={handleSave}>Save Profile</button>

      </div>
    </div>
  );
}

export default Profile;
